class Solution(object):
	def nextGreaterElements(self, nums):
		"""
		:type nums: List[int]
		:rtype: List[int]
		"""
		if not nums:
			return nums
		maxNum = max(nums)
		res = []
		for i, num in enumerate(nums):
			if num == maxNum:
				res.append(-1)
			elif not res:
				for j in range(i+1, len(nums)):
					if nums[j] > num:
						res.append(nums[j])
						break
			elif nums[i-1] <= num < res[i-1]:
				res.append(res[-1])
			else:
				for k in nums[i+1:]+nums[:i]:
					if k > num:
						res.append(k)
						break
		return res

